import React from "react";

import "../Projects/Projects.css";

import LookingForMaecenas from "../../images/LookingForMaecenas.png";

const Card = (props) => {
  const handleClick = () => {};
  const holdTempClass = "cardBox border-0 ";
  return (
    <div className={holdTempClass + props.name}>
      <div className="content">
        <div className="front">
          <div className="frontCard">
            <div class="container-fluid">
              <div class="row">
                <div class="col-12 px-0">
                  <img
                    className="img-fluid"
                    alt="Card Background"
                    src={LookingForMaecenas}
                  />
                </div>
              </div>
            </div>
          </div>
        </div>
        <div className="back">
          <div class="container-fluid">
            <div class="row">
              <div class="col-12 px-0">
                <img
                  className="img-fluid"
                  alt="Card Background"
                  src={LookingForMaecenas}
                />
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Card;
